Yagdyg (; ) is a rural locality (a selo) in Khuchninsky Selsoviet, Tabasaransky District, Republic of Dagestan, Russia. Population:  There are 2 streets.
Geography
Yagdyg is located 5&nbsp;km northeast of Khuchni (the district's administrative centre) by road. Tatil is the nearest rural locality.
